from datetime import datetime
import collections


# 定义季节
def get_season(month):
 if month in [12, 1, 2]:
  return "冬季"
 elif month in [3, 4, 5]:
  return "春季"
 elif month in [6, 7, 8]:
  return "夏季"
 else:
  return "秋季"


# 解析时间段并统计的函数
def analyze_time_periods(time_periods_list):
 for index, time_periods in enumerate(time_periods_list):
  # 用于统计季节、月份和小时数的计数器
  season_counts = collections.defaultdict(int)
  month_counts = collections.defaultdict(int)
  hour_counts = collections.defaultdict(int)

  for time_period in time_periods:
   start_str, end_str = time_period.split("~")
   start_time = datetime.strptime(start_str, "%Y-%m-%d %H:%M")
   end_time = datetime.strptime(end_str, "%Y-%m-%d %H:%M")

   # 统计季节
   season = get_season(start_time.month)
   season_counts[season] += 1

   # 统计月份
   month_counts[start_time.month] += 1

   # 统计小时数（以开始时间为准）
   hour_counts[start_time.hour] += 1

  # 输出结果
  print("季节统计：")
  for season, count in season_counts.items():
   print(f"{season}: {count}次")

  print("\n月份统计：")
  for month, count in month_counts.items():
   print(f"{month}月: {count}次")

  print("\n小时统计：")
  for hour, count in sorted(hour_counts.items()):
   print(f"{hour}:00 - {hour + 1}:00: {count}次")

  # 分析哪个季节、哪个月份以及哪个时间段弃电概率大
  season_with_max_discard = max(season_counts, key=season_counts.get)
  month_with_max_discard = max(month_counts, key=month_counts.get)
  hour_with_max_discard = max(hour_counts, key=hour_counts.get)

  print(f"\n弃电概率最大的季节是：{season_with_max_discard}")
  print(f"弃电概率最大的月份是：{month_with_max_discard}月")
  print(f"一天中弃电概率最大的时间段是：{hour_with_max_discard}:00 - {hour_with_max_discard + 1}:00")
  print("\n" + "="*40)


